A Cannes, dans le quartier de La Californie, situé dans une résidence prestigieuse, cet appartement de type 3 pièces offre un cadre exceptionnel. Profitez d'une vue panoramique sur la mer, un parc centenaire classé à la végétation méditerranéenne, ainsi qu'une piscine, le tout sous la surveillance d'un gardien disponible 24h/24.
D'une superficie habitable d'environ 118m2, l'appartement se compose d'une entrée, un séjour lumineux s'ouvrant sur une spacieuse terrasse, en bénéficiant d’une vue mer panoramique, une cuisine indépendante, équipée avec une loggia attenante. Deux chambres en suite, chacune avec dressing et salle d'eau privative. L'appartement dispose d'un sauna et d'une buanderie.
Vous bénéficierez également d'un parking extérieur et d'une cave ;

Exclusive! Located in Vallauris, in a quiet residential area, on a 1502 sqm plot with swimming pool, a four-storey villa with a Loi Carrez surface area of 278.06 sqm, facing north-west, comprising:

- First floor: entrance hall with cupboard and linen room, four bedrooms with cupboard, four shower rooms, outside WC and pool room;

- Garden level: hallway, utility room, living room with summer kitchen, bedroom with en-suite shower room, guest WC and laundry room;

- 1st floor: landing leading to spacious living/dining room, kitchen, hallway with cupboard, guest WC, bedroom and bathroom;

- 2nd and top floor: a landing leading to a games room.

The villa, set in a 1,502 sqm private garden, features a swimming pool, pool house, porch, garage and two cellars.
